import "./App.css";
import React from "react";
import Navbar from "./components/Navbar/Navbar";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import About from "./components/Pages/About";
import Home from "./components/Pages/Home.js";
import Shell from "./components/Pages/Shell";
import Sides from "./components/Pages/Sides";
import Fresh from "./components/Pages/Fresh";
import Contact from "./components/Pages/Contact";
import GetQuote from "./components/Pages/GetQuote";
import Cooking from "./components/Pages/Cooking";

function App() {
	return (
		<Router>
			<Navbar></Navbar>
			<Switch>
				<Route path="/" exact component={Home} />
				<Route path="/" exact component={About} />
				<Route path="/" exact component={Shell} />
				<Route path="/" exact component={Sides} />
				<Route path="/" exact component={Fresh} />
				<Route path="/" exact component={Contact} />
				<Route path="/" exact component={GetQuote} />
				<Route path="/" exact component={Cooking} />
			</Switch>
		</Router>
	);
}

export default App;
